INSERT INTO `wp_options` VALUES("1199", "_transient_dash_5f25301ca0145abac6dfc3a0899dc43b", "<div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://wordpress.org/news/2017/03/wordpress-4-7-3-security-and-maintenance-release/\'>WordPress 4.7.3 Security and Maintenance Release</a> <span class=\"rss-date\">6. 3. 2017</span><div class=\"rssSummary\">WordPress 4.7.3 is now available. This is a security release for all previous versions and we strongly encourage you to update your sites immediately. WordPress versions 4.7.2 and earlier are affected by six security issues: Cross-site scripting (XSS) via media file metadata.  Reported by Chris Andrè Dale, Yorick Koster, and Simon P. Briggs. Control characters can trick redirect [&hellip;]</div></li></ul></div><div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://wptavern.com/u-s-department-of-defense-launches-code-mil-open-source-initiative-first-release-tests-impact-of-agpl-licensing\'>WPTavern: U.S. Department of Defense Launches Code.mil Open Source Initiative, First Release Tests Impact of AGPL Licensing</a></li><li><a class=\'rsswidget\' href=\'https://wptavern.com/wpweekly-episode-267-interview-with-aaron-d-campbell-wordpress-security-team-lead\'>WPTavern: WPWeekly Episode 267 – Interview With Aaron D. Campbell, WordPress Security Team Lead</a></li><li><a class=\'rsswidget\' href=\'https://heropress.com/essays/going-back-roots/\'>HeroPress: Going Back To My Roots</a></li></ul></div><div class=\"rss-widget\"><ul><li class=\"dashboard-news-plugin\"><span>Popular Plugin:</span> Page Builder by SiteOrigin&nbsp;<a href=\"plugin-install.php?tab=plugin-information&amp;plugin=siteorigin-panels&amp;_wpnonce=51c66ad370&amp;TB_iframe=true&amp;width=600&amp;height=800\" class=\"thickbox open-plugin-details-modal\" aria-label=\"Install Page Builder by SiteOrigin\">(Install)</a></li></ul></div>", "no");
